" Zed Dark Mode Theme
" Author: Generated based on user specifications
" Focus: Pink and Black/White tones

set background=dark
highlight clear
syntax reset

" Define colors
let s:black           = { "gui": "#000000", "cterm": "232" }
let s:medium_gray     = { "gui": "#767676", "cterm": "243" }
let s:white           = { "gui": "#F1F1F1", "cterm": "15"  }
