### Verwendung:
1. Speichere den Code in einer Datei, z. B. `zed_dark.vim`.
2. Kopiere die Datei in dein Vim-Farbschema-Verzeichnis:
   ```
   ~/.vim/colors/zed_dark.vim
   ```
   oder für Neovim:
   ```
   ~/.config/nvim/colors/zed_dark.vim
   ```
3. Aktiviere das Farbschema in deiner `.vimrc` oder `init.vim`:
   ```vim
   colorscheme zed_dark
   ```

