Ah, verstanden! Hier ist ein JSON-Theme für die IDE **Zed**, das die von dir angegebenen Farben verwendet und sich auf Pink- und Schwarz-Weiß-Töne konzentriert. Dieses Theme ist im JSON-Format und kann in Zed verwendet werden.

```json
{
  "$schema": "vscode://schemas/color-theme",
  "name": "Zed Dark Pink",
  "type": "dark",
  "colors": {
    "editor.background": "#000000", // Black
    "editor.foreground": "#F1F1F1", // White
    "editorLineNumber.foreground": "#767676", // Medium Gray
    "editorLineNumber.activeForeground": "#ff5f87", // Dark Pink
    "editorCursor.foreground": "#FFFFFF", // Actual White
    "editor.selectionBackground": "#4E4E4E", // Lighter Black
    "editor.inactiveSelectionBackground": "#262626", // Light Black
    "editor.selectionHighlightBackground": "#d75f87", // Light Pink
    "editor.wordHighlightBackground": "#121212", // Subtle Black
    "editor.wordHighlightStrongBackground": "#262626", // Light Black
    "editor.findMatchBackground": "#ff5f87", // Dark Pink
    "editor.findMatchHighlightBackground": "#d75f87", // Light Pink
    "editor.lineHighlightBackground": "#121212", // Subtle Black
    "editorWhitespace.foreground": "#4E4E4E", // Lighter Black
    "editorIndentGuide.background": "#767676", // Medium Gray
    "editorIndentGuide.activeBackground": "#C6C6C6", // Lighter Gray
    "editorRuler.foreground": "#4E4E4E", // Lighter Black
    "editorBracketMatch.background": "#d75f87", // Light Pink
    "editorBracketMatch.border": "#ff5f87", // Dark Pink
    "editorGutter.background": "#000000", // Black
    "editorGutter.modifiedBackground": "#F3E430", // Yellow
    "editorGutter.addedBackground": "#10A778", // Dark Green
    "editorGutter.deletedBackground": "#C30771" // Dark Red
  },
  "tokenColors": [
    {
      "scope": ["comment", "punctuation.definition.comment"],
      "settings": {
        "foreground": "#4E4E4E", // Lighter Black
        "fontStyle": "italic"
      }
    },
    {
      "scope": ["string", "constant.character.escape"],
      "settings": {
        "foreground": "#d75f87" // Light Pink
      }
    },
    {
      "scope": ["constant.numeric", "constant.language"],
      "settings": {
        "foreground": "#ff5f87" // Dark Pink
      }
    },
    {
      "scope": ["variable", "variable.parameter"],
      "settings": {
        "foreground": "#F1F1F1" // White
      }
    },
    {
      "scope": ["keyword", "storage.type", "storage.modifier"],
      "settings": {
        "foreground": "#d75f87" // Light Pink
      }
    },
    {
      "scope": ["entity.name.function", "support.function"],
      "settings": {
        "foreground": "#ff5f87" // Dark Pink
      }
    },
    {
      "scope": ["entity.name.type", "entity.name.class"],
      "settings": {
        "foreground": "#F3E430" // Yellow
      }
    },
    {
      "scope": ["entity.other.attribute-name"],
      "settings": {
        "foreground": "#20BBFC" // Blue
      }
    },
    {
      "scope": ["support.type", "support.class"],
      "settings": {
        "foreground": "#5FD7A7" // Light Green
      }
    },
    {
      "scope": ["invalid", "invalid.deprecated"],
      "settings": {
        "foreground": "#FFFFFF", // Actual White
        "background": "#C30771" // Dark Red
      }
    },
    {
      "scope": ["meta.function-call", "meta.method-call"],
      "settings": {
        "foreground": "#ff5f87" // Dark Pink
      }
    },
    {
      "scope": ["meta.tag", "entity.name.tag"],
      "settings": {
        "foreground": "#d75f87" // Light Pink
      }
    },
    {
      "scope": ["meta.property-name"],
      "settings": {
        "foreground": "#A8A8A8" // Light Gray
      }
    },
    {
      "scope": ["meta.separator"],
      "settings": {
        "foreground": "#767676" // Medium Gray
      }
    },
    {
      "scope": ["meta.brace"],
      "settings": {
        "foreground": "#C6C6C6" // Lighter Gray
      }
    }
  ]
}
```

### Erklärung der Struktur:
1. **`colors`**: Definiert die allgemeinen Farben für die Benutzeroberfläche der Zed-IDE, wie den Hintergrund, die Schriftfarbe, die Auswahlfarbe usw.
2. **`tokenColors`**: Definiert die Farben für spezifische Syntaxelemente wie Kommentare, Strings, Schlüsselwörter, Funktionen usw. Hier werden die Pink- und Schwarz-Weiß-Töne bevorzugt verwendet.

### Verwendung in Zed:
1. Speichere den JSON-Code in einer Datei, z. B. `zed-dark-pink.json`.
2. Öffne Zed und gehe zu den Einstellungen.
3. Suche nach dem Ordner, in dem benutzerdefinierte Themes gespeichert werden (normalerweise im `.config`-Verzeichnis oder einem ähnlichen Speicherort).
4. Kopiere die Datei `zed-dark-pink.json` in den entsprechenden Ordner.
5. Wähle das Theme in den Zed-Einstellungen aus.

